import React, { Component } from "react";

const LoadingProduct = () => {
  return (
    <div className="product loading">
      <div className="product-image" />
      <div className="product-text" />
      <div className="product-text" />
      <div className="product-text" />
      <div className="product-button" />
    </div>
  );
};

export default LoadingProduct;
